description:
Kopieer de inhoud van &quot;copy to sd&quot; naar je geheugenkaart.

Navigeer met je gsm naar de inhoud van je geheugenkaart 
en open &quot;SygicDrive75_S60.sis&quot;

Dit installeert je programma op je gsm, na installatie start je &quot;Sygic DRIVE&quot;

Dan vraagt het programma om te activeren, kies handmatig.

Ga naar de website      &lt;a href=&quot; http://3ppc.net/sygicgen.php&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt; http://3ppc.net/sygicgen.php&lt;/a&gt;

en geef daar de code in die op je gsm staat, klik op generate en je krijt je licence code

geef die code op in je gsm en je kan navigeren.
